    [],nt"revision_timestamp": "2015-05-07T03:35:04.913755",nt"name": "non-flammable-high-voltage-electrolytes-for-lithium-ion-batteries-project",nt"isopen":
    true,nt"url": null,nt"notes": "An electrolyte will be demonstrated for
    lithium ion batteries with increased range of charge and discharge voltages and
    with improved fire safety.  Experimental electrolytes will be prepared in the anhydrous
    state and compared with existing commercial electrolyte formulations for conductivity,
    voltage limits and flammability.  Coin cells will be used to provide proof of concept
    and a prismatic cell design prepared to meet NASA mission goals for the Altair ascent
    stage and human safety for EVA suits.",nt"license_title": "U.S. Government
